    //播放动画（转盘转动）
    GameView.prototype.startAnimation = function () {
        if (this.timberInterval) {
            clearInterval(this.timberInterval);
        }
        this.timber.rotation = 0;
        this.timer.loop(10, this, this.rotate);
        // this.timberInterval = setInterval(() => {
        //     this.timber.rotation += this.rotations;
        // }, this.rate - this.rateOffset);
    };
    GameView.prototype.rotate = function () {
        this.timber.rotation += this.rotations;
    };
    GameView.prototype.stopAnimation = function () {
        var _this = this;
        this.timer.clear(this, this.rotate);
        this.timer.clear(this, this.rotate2);
        if (this.timberInterval) {
            clearInterval(this.timberInterval);
        }
        // this.timber.rotation = 0;
        this.timberInterval = setInterval(function () {
            _this.timber.rotation += 0;
        }, this.rate - this.rateOffset);
        this.insertRotate.forEach(function (item) {
            if (item.time) {
                clearInterval(item.time);
            }
            var time = setInterval(function () {
                item.kunai.rotation += 0;
            }, _this.rate - _this.rateOffset);
            item.time = time;
        });
    };
    //射击动作
    GameView.prototype.shoot = function () {
        var _this = this;
        if (this.isShooting || this.knifeNum <= 0)
            return;
        this.isShooting = true;
        var func = function () {
            if (_this.calcCollision(_this.timber.rotation)) {
                //插入失败，弹飞飞刀，刷新重置当前关卡数据
                _this.moveoutKunai();
            }
            else {
                //插入成功
                _this.woodBits();
                _this.knifeNum -= 1;
                _this.playShootSound();
                _this.updateShidao(false);
                // //创建旋转飞刀
                // this.createRotateKunai();
                // 木桩被射中动画
                var timberX = _this.timber.x;
                var timberY = _this.timber.y;
                //创建旋转飞刀
                _this.createRotateKunai();
                Tween.to(_this.timber, { x: timberX + 10, y: timberY + 10 }, 100, Ease.bounceInOut)
                    .from(_this.timber, { x: timberX - 10, y: timberY - 10 }, 100, Ease.bounceInOut);
                _this.timber.addChild(_this.zheZhao);
                _this.zheZhao.visible = true;
                _this.zheZhao.alpha = 0.8;
                Laya.timer.once(10, _this, function () {
                    _this.zheZhao.visible = false;
                });
                Tween.to(_this.timber2, { x: timberX + 5, y: timberY + 5 }, 100, Ease.bounceInOut)
                    .from(_this.timber2, { x: timberX - 5, y: timberY - 5 }, 100, Ease.bounceInOut);
                Tween.to(_this.timber, { x: timberX, y: timberY }, 1, Ease.bounceInOut, Handler.create(_this, _this.callBack));
                _this.kunai.alpha = 0;
                // this.updateScores();
            }
        };
        Tween.to(this.kunai, { y: 670 }, 75, Ease.linearIn, Handler.create(this, func));
    };
