    GameView.prototype.createRotateKunai = function (kunaiRotate) {
        var _this = this;
        // 数据存储木桩上的飞刀坐标
        // 有kunaiRotate则是随机生成的飞刀
        var rotate = typeof kunaiRotate === 'number' ? kunaiRotate : this.timber.rotation;
        var range = [];
        range.push(rotate);
        // 生成木桩上的飞刀
        var kunai = new Sprite();
        kunai.loadImage("gameImg/dao_" + ("" + this.level) + ".png");
        kunai.pivotX = this.knifeImg.width / 2;
        kunai.pivotY = -90;
        // kunai.x = this.targetImg.x;
        // kunai.y = this.targetImg.y;
        kunai.width = this.knifeImg.width;
        kunai.height = this.knifeImg.height;
        kunai.x = this.targetImg.width / 2;
        kunai.y = this.targetImg.height / 2;
        // 如果是用kunaiRotate做判断需要乘以-1
        kunai.rotation = typeof kunaiRotate === 'number' ? -kunaiRotate : 0;
        this.timber2.addChildAt(kunai, this.timberLayerNum);
        var time = setInterval(function () {
            kunai.rotation += _this.rotations;
        }, this.rate - this.rateOffset);
        var obj = { id: this.timber2.rotation, range: range, kunai: kunai, time: time };
        this.insertRotate.push(obj);
        this.resetRotateKunai();
    };
