    GameView.prototype.yunsuFor4 = function () {
        if (Math.floor((this.timber.rotation % 360)) == 0) {
            this.isTrigger = true;
        }
        if (!this.isSkip && this.isTrigger) {
            if (this.ry > this.maxRy) {
                this.ry = 0;
                this.isSkip = true;
                return;
            }
            this.rotations = 3 - this.ry;
            this.ry += this.rSpeed;
        }
        else if (this.isSkip && this.isTrigger) {
            if (this.ry > this.maxRy) {
                this.ry = 0;
                this.rotations = 3;
                this.isSkip = false;
                this.isTrigger = false;
                return;
            }
            this.rotations = this.ry;
            this.ry += this.rSpeed;
        }
    };
